    import React, { useState } from "react";
    import { Container, Row, Col, Form, Button, Card } from "react-bootstrap";

    function LoginForm({ onLoginSuccess }) {
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [error, setError] = useState("");

    const handleSubmit = async (e) => {
        e.preventDefault();
        // Call your backend (see previous code), handle success/error
    };

    return (
        <Container fluid className="vh-100" style={{ background: "#4d6cfb" }}>
        <Row className="h-100 align-items-center">
            <Col md={6} className="d-none d-md-block">
            <div className="text-white px-5">
                <h1 className="mb-3">BOOTSTRAP BRAIN</h1>
                <h3>
                We make digital products that drive you to stand out.
                </h3>
                <p>
                We write words, take photos, make videos, and interact with artificial intelligence.
                </p>
            </div>
            </Col>
            <Col md={6}>
            <Card className="p-4 shadow" style={{ maxWidth: 400, margin: "auto" }}>
                <h4 className="mb-4 text-center">Sign in</h4>
                <Form onSubmit={handleSubmit}>
                <Form.Group className="mb-3">
                    <Form.Label>Email</Form.Label>
                    <Form.Control
                    type="email"
                    placeholder="Email"
                    value={email}
                    onChange={e => setEmail(e.target.value)}
                    required
                    />
                </Form.Group>
                <Form.Group className="mb-3">
                    <Form.Label>Password</Form.Label>
                    <Form.Control
                    type="password"
                    placeholder="Password"
                    value={password}
                    onChange={e => setPassword(e.target.value)}
                    required
                    />
                </Form.Group>
                <Form.Group className="mb-3">
                    <Form.Check type="checkbox" label="Keep me logged in" />
                </Form.Group>
                <Button variant="primary" type="submit" className="w-100">
                    Log in now
                </Button>
                <div className="mt-3 d-flex justify-content-between">
                    <a href="#">Forgot password</a>
                    <a href="#">Sign up</a>
                </div>
                <hr />
                <p className="text-center">Or continue with</p>
                <div className="d-flex justify-content-center gap-2">
                    <Button variant="outline-secondary" size="sm">G</Button>
                    <Button variant="outline-secondary" size="sm">F</Button>
                    <Button variant="outline-secondary" size="sm">A</Button>
                </div>
                </Form>
                {error && <div className="text-danger mt-2">{error}</div>}
            </Card>
            </Col>
        </Row>
        </Container>
    );
    }

    export default LoginForm;
